INSERT INTO notice (id, title, contents, author, is_open, created_at, updated_at) VALUES
(1, '안전 교육 이수 안내', '전 직원 대상 안전 교육 이수가 필수입니다. 12월 말까지 완료 부탁드립니다.', '이지은', True, NOW(), NOW()),
(2, '하절기 근무 복장 안내', '6월 1일부터 하절기 근무 복장이 적용됩니다. 복장 규정 확인 부탁드립니다.', '김태현', True, NOW(), NOW()),
(3, '하절기 근무 복장 안내', '6월 1일부터 하절기 근무 복장이 적용됩니다. 복장 규정 확인 부탁드립니다.', '본사 운영팀', True, NOW(), NOW()),
(4, '설 명절 배송 일정 안내', '설 연휴 기간 물류센터 휴무로 1월 20일-25일 배송이 중단됩니다. 미리 발주 부탁드립니다.', '본부장', False, NOW(), NOW()),
